// const { json } = require("stream/consumers");

$(function () {
    // 提供部门
    let provideData = [];
    let num1 = null, num2 = null, num3 = null;
    let provideRes = axiosAjax('/screen/analysis/getOrgGiveTop').responseJSON;
    if (provideRes.code === 1) {
        num1 = provideRes.data.count;
        $('#provide_num').text(provideRes.data.count + "个")
        provideRes.data.top.forEach(item => {
            if (item.count == 0) {
                provideData.push({
                    name: '* * *',
                    value: item.count,
                    symbol: ""
                })
            } else {
                provideData.push({
                    name: item.orgName,
                    value: item.count,
                    symbol: ""
                })
            }
        })
    }
    // // 需求部门
    let demandData = [];
    let demandRes = axiosAjax('/screen/analysis/getOrgDemandedTop').responseJSON;
    if (demandRes.code === 1) {
        num2 = demandRes.data.count
        $('#demand_num').text(demandRes.data.count + "个")
        demandRes.data.top.forEach(item => {
            if (item.count === 0) {
                demandData.push({
                    name: '* * *',
                    value: item.count,
                })
            } else {
                demandData.push({
                    name: item.orgName,
                    value: item.count,
                })
            }

        })
    }
    // num3 = num1 / num2 % 100;
    $('#proportion').html(num1 + '/' + num2);


    let myChart = echarts.init(document.getElementById('provide_demand'));
    let option = {
        title: {
            top: '5%',
            left: 'center',
            text: "{a|[}{b|数据提供部门与需求部门}{x|]}",
            textStyle: {
                rich: {
                    a: {
                        color: 'rgb(105, 216, 255)',
                        fontSize: 18,
                        width: 30
                    },
                    b: {
                        color: '#fff',
                        fontSize: 16,
                    },
                    x: {
                        color: 'rgb(105, 216, 255)',
                        fontSize: 18,
                        width: 30
                    },
                }
            }
        },
        series: [
            {
                type: 'tree',
                data: [
                    {
                        "name": "大数据管理中心",
                        "value": "",
                        "symbol": 'image://data:image/png;base64,',
                        "symbolSize": [100, 100],
                        "children": provideData
                    }
                ],
                height: '100%',
                width: '30%',
                top: '1%',
                left: '20%',
                bottom: '1%',
                right: '50%',
                orient: 'RL',
                label: {
                    position: 'top',
                    verticalAlign: 'bottom',
                    align: 'center',
                    color: 'rgb(105, 216, 255)',
                    fontSize: 14,
                },
                leaves: {
                    label: {
                        position: 'left',
                        verticalAlign: 'middle',
                        align: 'right',
                        color: '#fff',
                        fontSize: 12,
                        formatter: (params) => {
                            return `{a|${params.name}}  {b|${params.value}}`
                        },
                        rich: {
                            a: {
                                color: '#fff',
                            },
                            b: {
                                color: '#fff',
                                width: 30
                            },
                        }
                    }
                },
                lineStyle: {
                    color: 'rgb(1, 215, 253)',
                },
                itemStyle: {
                    color: 'transparent',
                    borderWidth: 0,
                },
            },
            {
                type: 'tree',
                data: [
                    {
                        "name": "",
                        // "symbol": "",
                        "value": "",
                        "children": demandData
                    }
                ],
                height: '100%',
                width: '30%',
                top: '1%',
                left: '50%',
                bottom: '1%',
                right: '9%',
                symbol: 'triangle',
                symbolSize: 7,
                symbolRotate: -90,
                orient: 'LR',
                label: {
                    position: 'left',
                    verticalAlign: 'bottom',
                    align: 'center',
                    color: '#fff',
                    formatter: (params) => {
                        return `{a|${params.value}}  {b|${params.name}}`
                    },
                    rich: {
                        a: {
                            color: '#fff',
                            width: 30
                        },
                        b: {
                            color: '#fff',
                        },
                    }
                },
                leaves: {
                    label: {
                        position: 'right',
                        verticalAlign: 'middle',
                        align: 'left'
                    }
                },
                lineStyle: {
                    color: 'rgb(1, 215, 253)',
                },
                itemStyle: {
                    color: 'rgb(105, 216, 255)',
                    // borderWidth: 0
                },
            }
        ]
    }

    myChart.setOption(option);
})